import axios from 'axios'
import React from 'react'


function Home() {
  const[name,setName]=useState('')
  useEffect(()=>{
    axios.get('/http://localhost:8081')
    .then(res =>{
      console.log(res)
      if(res.data.valid){
         setName(res.data.username)
      }
    })
    .catch(err=> console.log(err))
  })
  return (
    <div>
        <h1>Home</h1>
    </div>
  )
}

export default Home
